import * as Types from '../constants/ActionTypes';

export  const actFilter = (filter) => {
    return {
        type : Types.FILTER_,
        filter
    }
}
export  const actFilterCourse = (filter) => {
    return {
        type : Types.FILTER_COURSE,
        filter
    }
}
